class Swapper {
	public int swap(int [] arr) {
		int [] tmparr;
		int size;
		int i;
		size = arr.length;
		tmparr= new int [size];
		i=0;
		while(i<size){
			tmparr[i]=arr[size-i-1];
			i=i +1;
		}
		arr = tmparr;
		i=0;
		while(i < 9){
			System.out.println(arr[i]);
			i=i+1;
		}
		return 0;
	}
}

